const ExpenseList=()=>{
  const  expenses=[
      {id:123123,name:"Shopping",cost:50},
      {id:123123,name:"Holiday",cost:300},
      {id:123123,name:"Transportation",cost:70},
      {id:123123,name:"Fuel",cost:40},
      {id:123123,name:"Childcare",cost:500}
    ];
    return(
        <ul className="list-group">
            {expenses.map((expense)=>(
                <ExpenseItem id={expense.id} name={expense.name} cost={expense.cost}></ExpenseItem>
            ))

            }
        </ul>
    );
}
export default ExpenseList;
